import React, { Component } from 'react';
import logo from '../logo.svg';
import '../css/Livestream.css';




class Livestream extends Component {
    render() {
        return (

            <div>
                <div id={"live-header"}>
                    <p className={"h1"}>
                        A440 Livestream Chanel
                    </p>
                </div>
            </div>
        );
    }
}

export default Livestream;
